webpackJsonp([1676073966197],{378:function(a,n){a.exports={data:{site:{siteMetadata:{title:"白鹤Snow",author:"Snow Grus"}},markdownRemark:{id:"/Users/gruis/work/github/snowgrus.github.io/src/pages/2017-10-17-react-component-decisions/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>在 React 开发的过程中我们常常会遇到一些抉择，下面我将选取其中一些个人认为重要的抉择来一一分析。但请记住以下所说的都只是我的建议，可能有一些房面我也没有考虑到，大家还是需要依据实际情况自己选择最合适的，切勿随波逐流。大概需要 10 分钟</p>\n</blockquote>\n<h2>抉择 1：开发环境搭建</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/26b75be1a23051bc0ba6db40910f7bc2-dc421.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 506px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.6798418972332%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Types"\n        title=""\n        src="/static/26b75be1a23051bc0ba6db40910f7bc2-ba7d6.png"\n        srcset="/static/26b75be1a23051bc0ba6db40910f7bc2-9e5a4.png 163w,\n/static/26b75be1a23051bc0ba6db40910f7bc2-fff70.png 325w,\n/static/26b75be1a23051bc0ba6db40910f7bc2-ba7d6.png 650w,\n/static/26b75be1a23051bc0ba6db40910f7bc2-3ed62.png 975w,\n/static/26b75be1a23051bc0ba6db40910f7bc2-dc421.png 1012w"\n        sizes="(max-width: 506px) 100vw, 506px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>通用场景建议使用 <a href="https://github.com/facebookincubator/create-react-app">create-react-app</a>，它将满足你大部分的开发需求，如果默认配置不能满足你的需求，运行 <code>npm run eject</code> 按需修改你的配置吧。</p>\n<p>其他可替代</p>\n<ul>\n<li><a href="https://github.com/gatsbyjs/gatsby">Gatsby</a> 适用于开发静态网站</li>\n<li><a href="https://github.com/zeit/next.js">Next.js</a> 适用于前后端同构方案</li>\n</ul>\n<p>如果以上皆不能满足你的需求时，亲，自己开发吧。</p>\n<h2>抉择 2：类型</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/6adb5cd639212d1983f70fd39554f5c7-40669.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 505px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 81.1881188118812%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Types"\n        title=""\n        src="/static/6adb5cd639212d1983f70fd39554f5c7-db19a.png"\n        srcset="/static/6adb5cd639212d1983f70fd39554f5c7-d77ad.png 163w,\n/static/6adb5cd639212d1983f70fd39554f5c7-8a454.png 325w,\n/static/6adb5cd639212d1983f70fd39554f5c7-db19a.png 650w,\n/static/6adb5cd639212d1983f70fd39554f5c7-060c2.png 975w,\n/static/6adb5cd639212d1983f70fd39554f5c7-40669.png 1010w"\n        sizes="(max-width: 505px) 100vw, 505px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n如果你懒得折腾，那 prop-types 可以满足你的类型验证，也会避免大部分的类型BUG。</p>\n<p>如果你喜欢折腾，还有下面两种选择：</p>\n<ul>\n<li><a href="https://github.com/Microsoft/TypeScript">TypeScript</a> </li>\n<li><a href="https://github.com/facebook/flow">Flow</a> </li>\n</ul>\n<h2>抉择 3：ES5(createClass) VS ES6(class)</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2c6d1c66c72fa20daee10eedf09cb471-8752c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 503px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 81.31212723658051%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Types"\n        title=""\n        src="/static/2c6d1c66c72fa20daee10eedf09cb471-4330f.png"\n        srcset="/static/2c6d1c66c72fa20daee10eedf09cb471-16805.png 163w,\n/static/2c6d1c66c72fa20daee10eedf09cb471-035cd.png 325w,\n/static/2c6d1c66c72fa20daee10eedf09cb471-4330f.png 650w,\n/static/2c6d1c66c72fa20daee10eedf09cb471-601cf.png 975w,\n/static/2c6d1c66c72fa20daee10eedf09cb471-8752c.png 1006w"\n        sizes="(max-width: 503px) 100vw, 503px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n如果你开发环境使用的是ES5语法，那你没得选择只能使用createCalss，<a href="https://reactjs.org/docs/react-without-es6.html">非ES6环境下如何使用React</a></p>\n<p>如果你开发环境使用ES6语法，强烈建议使用 class，因为这是趋势</p>\n<h2>抉择 4：类 VS 纯函数</h2>\n<p>如果你不需要使用生命周期，尽可能使用纯函数，他能帮你更好的设计的你组件。</p>\n<h2>抉择 5：State</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/88f2761d8bf0a60c8a50d2e60e4d07a6-f5478.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 501px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 84.03193612774452%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="State"\n        title=""\n        src="/static/88f2761d8bf0a60c8a50d2e60e4d07a6-84875.png"\n        srcset="/static/88f2761d8bf0a60c8a50d2e60e4d07a6-adecd.png 163w,\n/static/88f2761d8bf0a60c8a50d2e60e4d07a6-7e92e.png 325w,\n/static/88f2761d8bf0a60c8a50d2e60e4d07a6-84875.png 650w,\n/static/88f2761d8bf0a60c8a50d2e60e4d07a6-075ab.png 975w,\n/static/88f2761d8bf0a60c8a50d2e60e4d07a6-f5478.png 1002w"\n        sizes="(max-width: 501px) 100vw, 501px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>抉择 6：绑定（Binding）</h2>\n<p>一张图搞定\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/6c24a16c0ea892d59c798cb0c9792411-af9a1.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 481px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 71.3097713097713%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Binding"\n        title=""\n        src="/static/6c24a16c0ea892d59c798cb0c9792411-af9a1.jpg"\n        srcset="/static/6c24a16c0ea892d59c798cb0c9792411-54f3f.jpg 163w,\n/static/6c24a16c0ea892d59c798cb0c9792411-4379f.jpg 325w,\n/static/6c24a16c0ea892d59c798cb0c9792411-af9a1.jpg 481w"\n        sizes="(max-width: 481px) 100vw, 481px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>抉择 7：样式（Styling）</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/0401059fbd988ab8be278e6b409c2040-4af1c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.61493411420204%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Styling"\n        title=""\n        src="/static/0401059fbd988ab8be278e6b409c2040-10273.png"\n        srcset="/static/0401059fbd988ab8be278e6b409c2040-9b14a.png 163w,\n/static/0401059fbd988ab8be278e6b409c2040-94962.png 325w,\n/static/0401059fbd988ab8be278e6b409c2040-10273.png 650w,\n/static/0401059fbd988ab8be278e6b409c2040-2fc6f.png 975w,\n/static/0401059fbd988ab8be278e6b409c2040-a8a2c.png 1300w,\n/static/0401059fbd988ab8be278e6b409c2040-4af1c.png 1366w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>抉择 8：复用逻辑</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/a2ee5e5084616609ff0a623368254c33-40669.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 505px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 80.59405940594058%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Reuse Logic"\n        title=""\n        src="/static/a2ee5e5084616609ff0a623368254c33-db19a.png"\n        srcset="/static/a2ee5e5084616609ff0a623368254c33-d77ad.png 163w,\n/static/a2ee5e5084616609ff0a623368254c33-8a454.png 325w,\n/static/a2ee5e5084616609ff0a623368254c33-db19a.png 650w,\n/static/a2ee5e5084616609ff0a623368254c33-060c2.png 975w,\n/static/a2ee5e5084616609ff0a623368254c33-40669.png 1010w"\n        sizes="(max-width: 505px) 100vw, 505px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>抉择 9：目录结构</h2>\n<p><a href="/images/avatar.jpg">dss</a></p>\n<h2>参考文献</h2>\n<p><a href="https://medium.com/m/global-identity?redirectUrl=https://medium.freecodecamp.org/8-key-react-component-decisions-cc965db11594">8-key-react-component-decisions</a></p>',frontmatter:{title:"React开发中面临的重要抉择",date:"October 17, 2017",originUrl:null}}},pathContext:{path:"/react/"}}}});
